import React, { Component } from 'react'
import styled from 'styled-components'

const Container = styled.div`
 &:active{
  padding: 0;
  margin: 0;
  opacity: 0.7;
 }
`
const ImgIcon = "/chart.svg"
const Icon = styled.img`
 position: fixed;
  width: 60px;
  height: 60px;
  bottom: 40px;
  right: 40px;
  border-radius: 50px;
  box-shadow: 2px 2px 3px #999;
  cursor: pointer;
`


export class Fab extends Component {
  render() {
    return (
      <Container>
        <Icon src={ImgIcon} alt="image-Fab" />
      </Container>
    )
  }
}

export default Fab
